	//phase active
	require(phase1,"Phase is not live yet");
	//check if address already reserved
	require(_reserved[msg.sender] == 0,"Already Reserved");
	//check reserve limit
	require(phase1ReserveCount <= maxPhase1, "Phase limit has been hit");
